import axios from 'axios';

export function saveFood(
    name,
    weight,
    proteinPer100g,
    fatsPer100g,
    kcalPer100g,
    proteinTotal,
    fatsTotal,
    kcalTotal
) {
    const dto = makeDTO();
    return axios.post(basePath + `/add`, dto);
}

const basePath = 'http://localhost:8080/foods';


function makeDTO(exerciseName, weight, reps, comment) {
    return {
        exerciseName: exerciseName, userId: "1", weight: weight, reps: reps, comment: comment
    };
}
